> Entertainment Judge dismisses copyright infringement case against Jay Z FILE - In this Feb. 23, 2015 file photo, Jay Z arrives at the 2015 Vanity Fair Oscar Party in Beverly Hills, Calif. A judge on Wednesday, Oct. 21, 2015, in Los Angeles, dismissed a copyright infringement case against the rapper over his 1999 hit "Big Pimpin'" before the case was sent to a jury. U.S. District Judge Christina A. Snyder ruled that the heir of an Egyptian composer did not have the right to pursue a copyright infringement claim. (Photo by Evan Agostini/Invision/AP, File) 
